  `access_token` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `password_otp` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `expiration` timestamp(0) NOT NULL DEFAULT '0000-00-00 00:00:00',
  `VIP` int(3) NULL DEFAULT NULL,
  `money` int(6) NOT NULL DEFAULT 0,
  `moneyb` int(6) NOT NULL DEFAULT 0,
  `lastGainHM` bigint(20) NOT NULL DEFAULT 0,
  `paypalNX` int(11) NULL DEFAULT 0,
  `lb` int(11) NOT NULL DEFAULT 0,
