INSERT INTO `wz_oxdata` VALUES (1, 1, '生活在丛林深处的怪猫是可以进行远距离攻击和近身攻击的强力的怪物。', '怪猫只会进行近身攻击。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 2, '火独眼兽、风独眼兽、冰独眼兽是长得差不多的怪物，其中只有火独眼兽有2只眼睛。', '所有的都是1只眼睛。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 3, '骑着扫帚飞来飞去的巫婆用强力的魔法光线攻击远距离的玩家。', '巫婆是近距离攻击的怪物。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 4, '骑着扫帚飞来飞去的巫婆惧怕圣属性魔法。', '巫婆惧怕圣属性魔法。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 5, '矿山僵尸和僵尸之中，僵尸的等级更高。', '两者的等级都是57级。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 6, '会飞的怪物蝙蝠每飞一段时间，就会吊在天花板上休息。', '不休息一直飞行。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 7, '黄金海岸可以看到的长得像梭子蟹的怪物红螃蟹偶尔会跳跃攻击。', '虽然长得像梭子蟹，但是也会跳跃攻击。', 'o');
INSERT INTO `wz_oxdata` VALUES (1, 8, '蓝独角狮是会进行冰冻攻击的怪物。', '是进行冰属性攻击，而且弱点是火属性的怪物。', 'o');
INSERT INTO `wz_oxdata` VALUES (1, 9, '长得像可爱的海龟一样的怪物乌龟会进行强力的远距离攻击。', '乌龟是会远距离攻击的怪物。', 'o');
INSERT INTO `wz_oxdata` VALUES (1, 100, '赤龙是龙系怪物中唯一能进行远距离攻击的怪物。', '赤龙和冰龙都会进行远距离攻击。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 101, '主要生活在沼泽地带的黑鳄鱼是比土龙等级更高的怪物。', '黑鳄鱼是(52级)，土龙是(45级)。', 'o');
INSERT INTO `wz_oxdata` VALUES (1, 102, '在勇士部落的周边可以见到土龙，他是青龙的进化种，远距离攻击是其特征。', '只会近距离攻击，不会远距离攻击。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 103, '冰峰雪域登场的所有怪物，都有惧怕火属性魔法的特点。', '黑雪人、黑企鹅王惧怕圣属性魔法。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 104, '小海狮在受到攻击时，会和头顶上的小海豹分离，一起进行攻击。', '小海狮无法分离。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 105, '等级为100的蝠魔不会因毒魔法而中毒。', '具有使毒魔法无效，惧怕圣魔法的特点。', 'o');
INSERT INTO `wz_oxdata` VALUES (1, 106, '坐着扫帚飞来飞去的巫婆是不死系怪物。', '巫婆虽然惧怕圣属性魔法，但并不是不死系怪物。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 107, '龙虾怪物大龙虾在吃了黄金炸虾之后会更容易捕捉。', '和黄金炸虾没有关系。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 108, '斧木妖是由于伐木工没有拔出斧子，因为怨恨而诞生的怪物。', '传说是由于伐木工没有拔掉斧子而发出怨恨，因此而重生。', 'o');
INSERT INTO `wz_oxdata` VALUES (1, 109, '北半球的水流漩涡是逆时针旋转的.', '水流旋转与地球自转有关，观察一下就知道，我们身处的北半球漩涡是逆时针的！', 'o');
INSERT INTO `wz_oxdata` VALUES (1, 110, '狼人在受到攻击时，会召唤分身进行攻击。', '狼人没有分身。', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 111, '童话村里登场的鬼怪中，绿色鬼怪可以用荞麦蒟蒻召唤。', '绿色鬼怪-荞麦蒟蒻', 'o');
INSERT INTO `wz_oxdata` VALUES (1, 112, '童话村里登场的鬼怪中，蓝色鬼怪可以用猪肉串召唤。', '蓝色鬼怪-谷茶', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 113, '童话村里登场的鬼怪中，黄色鬼怪可以用谷茶召唤。', '黄色鬼怪-猪肉串', 'x');
INSERT INTO `wz_oxdata` VALUES (1, 114, '冒险岛中最弱的怪物是“蘑菇仔”。', '不是蘑菇仔，蜗牛才是最弱的怪物。', 'x');
